Here's a program to find common elements in two arrays **in-place** (no extra data structures like sets), leveraging the idea of **two pointers** and **array modification** for efficiency.

```c++
#include <iostream>

void findCommonElements(int arr1[], int arr2[], int n1, int n2) {
  // 1. Sort both arrays (essential for in-place without extra DS)
  std::sort(arr1, arr1 + n1);
  std::sort(arr2, arr2 + n2);

  // 2. Use two pointers, one for each sorted array
  int i = 0, j = 0;

  // 3. Iterate through the sorted arrays, comparing elements
  while (i < n1 && j < n2) {
    if (arr1[i] == arr2[j]) {
      // Common element found, print or process it (here, we'll mark)
      arr1[i] = arr1[i] * 2;  // Example: Marking (adjust as needed)
      i++;
      j++;
    } else if (arr1[i] < arr2[j]) {
      // Move pointer for smaller element (arr1 in this case)
      i++;
    } else {
      // Move pointer for smaller element (arr2)
      j++;
    }
  }
}

int main() {
  int arr1[] = {2, 5, 7, 8, 11, 12};
  int arr2[] = {5, 8, 12, 15, 20};
  int n1 = sizeof(arr1) / sizeof(arr1[0]);
  int n2 = sizeof(arr2) / sizeof(arr2[0]);

  findCommonElements(arr1, arr2, n1, n2);

  // After the function, common elements are marked in arr1 (adjust your output)
  std::cout << "Common elements (marked in arr1): ";
  for (int i = 0; i < n1; i++) {
    if (arr1[i] % 2 != 0)  // Example: Print marked (adjust for your marking)
      std::cout << arr1[i] << " ";
  }
  std::cout << std::endl;

  return 0;
}
```

**Explanation**

1. **Sorting:** The core idea is to sort both arrays. This allows us to efficiently compare elements and move pointers without needing extra data structures for tracking common elements.

2. **Two Pointers:** We use two pointers, `i` for `arr1` and `j` for `arr2`, both initialized to 0.

3. **Comparison and Pointer Movement:**
   - If `arr1[i]` equals `arr2[j]`, we've found a common element. We mark it (in this example, by doubling its value in `arr1`) and move both pointers forward.
   - If `arr1[i]` is smaller, we move `i` to compare the next element in `arr1`.
   - If `arr2[j]` is smaller, we move `j` to compare the next element in `arr2`.

4. **In-Place Modification:** The marking of common elements within `arr1` itself is the in-place aspect.

**Key Points**

- Sorting is crucial for this approach.
- The marking method (doubling in the example) is flexible. You can adapt it to your desired output (printing, setting flags, etc.).
- This method has a time complexity of O(n log n) due to sorting and O(n) for the pointer iteration.



